package handsOn;

public class SwapNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=9, b=8, temp;
		
		System.out.println("Numbers before Swapping a:"+ a +" b:"+b);
		temp=a;
		a=b;
		b=temp;
		
		System.out.println("Numbers before Swapping a:"+ a +" b:"+b);
		

	}

}
